     "description": "HUAWEI FreeBuds 5\n\nNebula Black\\Isle Blue\\Ceramic White\n\nDimensions\nPer earbud\nHeight: 30.9 mm \n\nWidth: 21.7 mm \n\nDepth: 23.9 mm\n\nWeight: About 4.9 g ± 0.2 g\n\nCharging case\nHeight: 48.2 mm \n\nWidth: 61.8 mm \n\nDepth: 26.9 mm\n\nWeight: About 33.9 g ± 1.0 g\n\n*Product size\\ product weight\\ and related specifications are theoretical values only. Actual measurements between individual products may vary. All specifications are subject to the actual product.\n\nBattery\n\nBattery capacity\nPer earbud: 55 mAh (min)*\n\nCharging case: 410 mAh (min)*\n\nPlaytime\nMusic playback on 1 charge: 6.0 hours (with ANC enabled)**\n\nMusic playback on 1 charge: 7.5 hours (with ANC disabled)**\n\nMusic playback with charging case: 18.5 hours (with ANC enabled)**\n\nMusic playback with charging case: 28 hours (with ANC disabled)**\n\nCharging Time\nAbout 60 minutess for the earbuds (in the charging case)***\n\nAbout 110 for charging case without earbuds (wired)***\n\n*Actual capacity may vary slightly.\n\n**The battery life data come from Huawei labs with conditions by default: volume at 50%\\ and the AAC mode is enabled. The actual battery life may vary depending on the volume\\ audio source\\ environment interference\\ product features\\ and usage habits.\n\n***The charging data come from Huawei labs with the test condition: 25℃ at normal temperature conditions .\n\nControls\n\nEarBuds\nPress control: twice\/long press\n\nSwipe control: up\/down\n\nCharging case\nPress\n\nConnectivity\n\nBluetooth Compatibility:\nBT 5.2\n\nPop-Up Pair:\nSupported*\n\nSimultaneous Bluetooth connection with dual devices:\nSupported\n\n*Requires smartphones running EMUI10 or above.\n\nSensor\n\nHall sensor\/Cap sensor\n\nDriver\n\n10 mm dynamic driver\n\nAudio Technology\n\nActive noise cancellation\\ Call noise cancellation\\ Transparency mode\n\nSplash\\ Water\\ and Dust Resistant\n\nEarbuds:\nIP54\n\n*This product is not a professional waterproof device\\ but is splash resistant during normal use. It has been tested to reach the IP54 level in a lab under controlled conditions. The splash resistance is not permanent\\ and the protection may decrease with daily wear and tear.\n\nIn The Box\n\nEarbuds\n\nCharging case\n\nSilicone ear tips (three sizes) (Available in large\\ medium\\ and small sizes. The medium-sized pair is attached by default.)\n\nUSB-C charging cable\n\nQuick start guide (including safety information)\n\nWarranty card",
     "Product Description (Ar)": "\"هواوي فري بودز 5\n\nسديم أسود ، جزيرة الأزرق ، السيراميك الأبيض\n\nالأبعاد\nلكل سماعة أذن\nالارتفاع: 30.9 مم \n\nالعرض: 21.7 مم \n\nالعمق: 23.9 مم\n\nالوزن: حوالي 4.9 جرام-0.2 جرام\n\nحالة الشحن\nالارتفاع: 48.2 مم \n\nالعرض: 61.8 مم \n\nالعمق: 26.9 مم\n\nالوزن: حوالي 33.9 جرام - 1.0 جرام\n\n* حجم المنتج ووزن المنتج والمواصفات ذات الصلة هي قيم نظرية فقط. قد تختلف القياسات الفعلية بين المنتجات الفردية. جميع المواصفات تخضع للمنتج الفعلي.\n\nالبطارية\n\nسعة البطارية\nلكل سماعة أذن: 55 مللي أمبير (دقيقة)*\n\nحالة الشحن: 410 مللي أمبير (دقيقة)*\n\nوقت اللعب\nتشغيل الموسيقى على 1 تهمة: 6.0 ساعة (مع تمكين حزب المؤتمر الوطني الأفريقي)**\n\nتشغيل الموسيقى على 1 تهمة: 7.5 ساعة (مع تعطيل حزب المؤتمر الوطني الأفريقي)**\n\nتشغيل الموسيقى مع حالة الشحن: 18.5 ساعة (مع تمكين حزب المؤتمر الوطني الأفريقي)**\n\nتشغيل الموسيقى مع حالة الشحن: 28 ساعة (مع تعطيل حزب المؤتمر الوطني الأفريقي)**\n\nوقت الشحن\nحوالي 60 دقيقة لسماعات الأذن (في علبة الشحن)***\n\nحوالي 110 لشحن القضية دون سماعات الأذن (السلكية)***\n\n* قد تختلف السعة الفعلية قليلا.\n\n** بيانات عمر البطارية تأتي من مختبرات هواوي مع الظروف بشكل افتراضي: حجم في 50 ٪ ، ويتم تمكين وضع آك. قد يختلف عمر البطارية الفعلي اعتمادا على مستوى الصوت ومصدر الصوت وتداخل البيئة وميزات المنتج وعادات الاستخدام.\n\n*** بيانات الشحن تأتي من مختبرات هواوي مع حالة الاختبار: 25℃ في ظروف درجة الحرارة العادية .\n\nالضوابط\n\nسماعات الأذن\nاضغط على التحكم: مرتين \/ الضغط لفترة طويلة\n\nانتقاد السيطرة: أعلى \/ أسفل\n\nحالة الشحن\nالصحافة\n\nالاتصال\n\nالتوافق بلوتوث:\nبت 5.2\n\nزوج منبثق:\nدعم*\n\nاتصال بلوتوث متزامن مع الأجهزة المزدوجة:\nدعم\n\n* يتطلب الهواتف الذكية تشغيل إمو 10 أو أعلى.\n\nالاستشعار\n\nقاعة الاستشعار \/ كاب الاستشعار\n\nسائق\n\n10 مم سائق ديناميكي\n\nتقنية الصوت\n\nإلغاء الضوضاء النشط ، إلغاء ضوضاء المكالمة ، وضع الشفافية\n\nمقاومة للرذاذ والماء والغبار\n\nسماعات الأذن:\nآي بي 54\n\n* هذا المنتج ليس جهازا احترافيا مقاوما للماء ، ولكنه مقاوم للرذاذ أثناء الاستخدام العادي. وقد تم اختباره للوصول إلى مستوى إب 54 في المختبر تحت ظروف خاضعة للرقابة. مقاومة الرش ليست دائمة ، وقد تنخفض الحماية مع التآكل والتلف اليومي.\n\nفي المربع\n\nسماعات الأذن\n\nحالة الشحن\n\nأطراف أذن سيليكون (ثلاثة أحجام) (متوفرة بأحجام كبيرة ومتوسطة وصغيرة. يتم إرفاق الزوج متوسط الحجم افتراضيا.)\n\nكابل شحن يو اس بي سي\n\nدليل البدء السريع (بما في ذلك معلومات السلامة)\n\nبطاقة الضمان\"",
