     "description": "Play On\nFeaturing two mics on each earbud\\ a Belkin-engineered noise-reduction algorithm\\ and three EQ presets\\ these earbuds will enhance the sounds you want to hear while cutting out those you don’t. Get real all-day listening with 8 hours of battery life per charge and another 30 hours of power in the USB-C charging case—a truly impressive 38 hours of total playtime. Available in four fun\\ stylish colors and an IPX5-rated water-resistant design to keep up with weather and workouts\\ SOUND FORM Play earbuds are your perfect daily audio companions.\n\nPersonalize Your Sound\nCustomize your experience with three touch-controllable EQ presets for enhanced listening pleasure.\n\nClear Calls\nTwo microphones in each earbud and a Belkin-engineered noise-reduction algorithm provide audio clarity on all calls. ​  \n\nA Long-Lasting Charge\nIn addition to 8-hour non-stop playtime for each earbud\\ the compact charging case provides another 30 hours of charge. You’ll have 38 hours to talk\\ listen\\ and stream uninterrupted before having to charge.\n\nListen in Style\nFour fun colors are ready to complement your device\\ style\\ or mood. Choose from midnight\\ cloud\\ petal\\ and ocean—or get them all.\n\nGreat Audio Every Day\nThe 6mm  dynamic drivers provide consistently great audio\\ so you can fully appreciate your favorite playlists.\n\nReady To Go in Minutes\nShort on time? A quick\\ 10-minute charge will give 60 minutes of playtime. Got more time? With fast USB-C charging\\ you’ll have your earbuds and case loaded with a total 38 hours of playtime in just a 1.5-hour charge.  \n\nWater Resistance? No Sweat \nDon’t let light rain or a challenging workout get in the way of being connected. Built with IPX5 water and sweat resistance\\ our wireless earbuds help move you through everyday activities worry-free. \n\nQuick Pairing\nThe reliable Bluetooth® 5.2 chipset offers easy connection and pairing from 10 meters. All you need to worry about is what to play first.\n\nControl with a Tap\nWire-free\\ button-free touch controls in both earbuds let you tap to adjust volume\\ skip tracks\\ pick up and end calls\\ and even switch EQ presets.\n\nAt a Glance\n2 microphones in each earbud  \n3 touch-controllable EQ presets\n38 hours of battery life—8 hours of playtime for the earbuds\\ plus 30 hours in the charging case \n4 colors: Midnight\\ Cloud\\ Petal\\ and Ocean   \n6mm dynamic drivers\n10-minute charge will quickly give 60 minutes of playtime  \nFast USB-C charging fully charges case and buds in just 1.5 hours I\nPX5-rated sweat and water resistance  \nQuick\\ easy pairing with Bluetooth® 5.2\nIntuitive touch controls in both earbuds let you tap to adjust volume\\ skip tracks\\ and more\nPackage Includes\nSOUNDFORM Play True Wireless Earbuds \nCharging case \n3 pairs of silicone ear tips (S\/M\/L)  \nUSB-C® charging cable  \nQuick Start Guide  ",
