     "Product Title (Ar)": "سماعات الأذن اللاسلكية SOUNDFORM™ Rise True من بلكين",
     "size ": "no size",
     "color": "no color",
     "description": "Rise Into Great Sound\nThe sound quality you expect from great earbuds with convenient features that go above and beyond. Two microphones in each earbud mean you’ll always be heard on calls. The SOUNDFORM Rise True Wireless Earbuds are designed to get you through even the longest days with an impressive 7 hours of charge in each earbud and another 24 hours in the wireless charging case. The IPX5 water resistance rating protects them rain or shine while easy-to-use controls offer the power to change volume\\ skip tracks\\ and take calls\\ all at your fingertips.\n\n\n\n\n\nExtra-Long Battery Life\n7 hours of playtime per charge\\ plus another 24 hours of battery life in the wireless charging case. Power back up quickly with just ten minutes of charge yielding one hour of playtime.\n\nElevated\\ Powerful Sound\n6mm dynamic drivers deliver a consistent and high-quality listening experience for music\\ podcasts\\ or taking calls.\n\nBetter Streaming with Less Lag\nCut down on audio lag\\ so you get the best experience from your videos and other streaming media.\n\nDual Connect Technology\nUse either earbud on its own and keep one ear free to the outside world in mono mode.\n\nCrystal Clear Call Quality\nTwo microphones in each earbud and clear-call environmental noise cancelling technology keep calls connected and clear.\n\nQi Wireless Charging Case\nRecharge the earbuds quickly and easily in their included wireless case.\n\nSweat and splash resistant\nIPX5 rated materials protect the earbuds’ inner technology from workouts and weather.\n\nCustomizable comfort\nIncluded silicone ear tips in 3 sizes allow for all day use and comfort.\n\nAt a Glance:\n31 hours of combined battery life\nExcellent sound quality \nLow latency for superior video streaming\nDual connect technology and 2 microphones in each earbud\nBluetooth compatible with 10m\/30ft range\nIPX5 rated against water and sweat\n3 size comfortable ear tips\nProtected by a 1-year warranty\nPackage Includes:\nSOUNDFORM™ Rise True Wireless Earbuds\nWireless charging case \nUSB-C cable\n3 sizes silicone ear tips",
     "Product Description (Ar)": "ارتقي إلى الصوت الرائع\nجودة الصوت التي تتوقعها من سماعات الأذن الرائعة مع ميزات مريحة تتجاوز الحدود. وجود ميكروفونين في كل سماعة أذن يعني أنه سيتم سماعك دائمًا أثناء المكالمات. تم تصميم سماعات الأذن اللاسلكية SOUNDFORM Rise True لتتمكن من قضاء أطول الأيام مع 7 ساعات من الشحن المذهل في كل سماعة أذن و24 ساعة أخرى في علبة الشحن اللاسلكي. يحمي تصنيف مقاومة الماء IPX5 المطر أو أشعة الشمس بينما توفر عناصر التحكم سهلة الاستخدام القدرة على تغيير مستوى الصوت وتخطي المسارات وتلقي المكالمات، كل ذلك في متناول يدك.\n\n\n\n\n\nعمر بطارية طويل جدًا\n7 ساعات من وقت التشغيل لكل شحنة، بالإضافة إلى 24 ساعة أخرى من عمر البطارية في علبة الشحن اللاسلكي. يمكنك استعادة الطاقة بسرعة مع عشر دقائق فقط من الشحن مما يمنحك ساعة واحدة من وقت التشغيل.\n\nصوت مرتفع وقوي\nتوفر المحركات الديناميكية مقاس 6 مم تجربة استماع متسقة وعالية الجودة للموسيقى أو الملفات الصوتية أو تلقي المكالمات.\n\nبث أفضل مع تأخر أقل\nقلل من تأخر الصوت، حتى تحصل على أفضل تجربة من مقاطع الفيديو ووسائط البث الأخرى.\n\nتقنية الاتصال المزدوج\nاستخدم إحدى سماعات الأذن بمفردها واحتفظ بأذن واحدة مفتوحة للعالم الخارجي في الوضع الأحادي.\n\nجودة مكالمة واضحة للغاية\nيوجد ميكروفونان في كل سماعة أذن وتقنية إلغاء الضوضاء البيئية للمكالمات الواضحة تبقي المكالمات متصلة وواضحة.\n\nحالة الشحن اللاسلكي تشي\nقم بإعادة شحن سماعات الأذن بسرعة وسهولة في العلبة اللاسلكية المرفقة بها.\n\nمقاوم للعرق والرذاذ\nتعمل المواد الحاصلة على تصنيف IPX5 على حماية التكنولوجيا الداخلية لسماعات الأذن من التدريبات والطقس.\n\nراحة قابلة للتخصيص\nتشتمل على أطراف أذن من السيليكون بثلاثة أحجام تسمح بالاستخدام والراحة طوال اليوم.\n\nلمحة:\n31 ساعة من عمر البطارية المدمج\nجودة صوت ممتازة\nزمن وصول منخفض لتدفق الفيديو الفائق\nتقنية الاتصال المزدوج وميكروفونين في كل سماعة أذن\nبلوتوث متوافق مع نطاق 10 متر\/30 قدم\nتصنيف IPX5 ضد الماء والعرق\n3 أطراف أذن مريحة بحجم 3\nمحمية بضمان لمدة سنة واحدة\nالشحنة تحتوي:\nسماعات أذن SOUNDFORM™ Rise True اللاسلكية\nحالة الشحن اللاسلكي\nكابل USB-C\n3 مقاسات من أطراف الأذن المصنوعة من السيليكون",
