     "description": "SAMSUNG Galaxy Buds 2 True Wireless Earbuds Noise Cancelling Ambient Sound Bluetooth Lightweight Comfort Fit Touch Control\\ Graphite.\n\nYOUR EARS NEVER HAD IT SO GOOD: Galaxy Buds2 ear buds take your passion for music to new heights with booming sound that makes you feel like you're on stage with your favorite band.\n\nNote : If the size of the earbud tips does not match the size of your ear canals or the headset is not worn properly in your ears\\ you may not obtain the correct sound qualities or call performance. Change the earbud tips to ones that fit more snugly in your ears\n\nTUNE OUT NOISES\\ TUNE IN VOICES: Active Noise Cancellation blocks out unwanted sounds\\ helping you keep your focus wherever you are; Low latency Ambient Sound mode picks up the sounds you want to hear\\ so you always have the perfect audio level for every moment\n\nFEELS GOOD WHILE LOOKING GOOD: Galaxy Buds2 have a comfortable\\ low profile design that's 10% smaller and lighter than Galaxy Buds Plus; You may get to the end of your playlist before you remember you're wearing them at all\n\nHEAR CLEARLY\\ SPEAK CONFIDENTLY: The earbuds’ 3 microphones and noise reduction technology ensures voices are transmitted crisply and clearly\\ whether you're chatting with a friend or leading a high stakes conference call\n\nPOWER WORTHY OF YOUR LONGEST PLAYLIST: Indulge your love of music with a long-lasting battery that's up to the job — so your music doesn’t stop until you do\n\nTAP FOR TOTAL CONTROL: Control your playlist or answer calls with the tap of a finger with touch control — no more fumbling for your phone to change a song\n\nSWITCH IT UP: With Auto Switch\\ the earphones detect what connection you need and instantly shifts audio to that Galaxy device; Shift effortlessly between your Galaxy phone\\ tablet\\ watch\\ or PC. Buds Controller is compatible with Galaxy Buds plus\\ Galaxy Watch4\\ and their respective following models.",
     "Product Description (Ar)": "سماعات أذن SAMSUNG Galaxy Buds 2 True Wireless بخاصية إلغاء الضوضاء والصوت المحيط والبلوتوث وخفيفة الوزن ومريحة وتحكم باللمس، جرافيت.\n\nلم تكن أذنيك على ما يرام من قبل: ترتقي سماعات الأذن Galaxy Buds2 بشغفك بالموسيقى إلى آفاق جديدة مع صوت مزدهر يجعلك تشعر وكأنك على المسرح مع فرقتك المفضلة.\n\nملاحظة: إذا كان حجم أطراف سماعات الأذن لا يتطابق مع حجم قنوات أذنك أو لم يتم ارتداء سماعة الرأس بشكل صحيح في أذنيك، فقد لا تحصل على جودة الصوت الصحيحة أو أداء المكالمات. قم بتغيير أطراف سماعات الأذن إلى تلك التي تناسب أذنيك بشكل أكثر راحة\n\nضبط الضوضاء، وضبط الأصوات: يعمل إلغاء الضوضاء النشط على حجب الأصوات غير المرغوب فيها، مما يساعدك على الحفاظ على تركيزك أينما كنت؛ يلتقط وضع الصوت المحيطي ذو زمن الاستجابة المنخفض الأصوات التي تريد سماعها، بحيث يكون لديك دائمًا مستوى الصوت المثالي لكل لحظة\n\nشعور جيد مع مظهر جيد: تتميز سماعات Galaxy Buds2 بتصميم مريح ومنخفض الحجم أصغر وأخف بنسبة 10% من Galaxy Buds Plus؛ قد تصل إلى نهاية قائمة التشغيل الخاصة بك قبل أن تتذكر أنك ترتديها على الإطلاق\n\nاستمع بوضوح، تحدث بثقة: تضمن 3 ميكروفونات وتقنية تقليل الضوضاء في سماعات الأذن نقل الأصوات بوضوح ووضوح، سواء كنت تتحدث مع صديق أو تقود مكالمة جماعية عالية المخاطر\n\nقوة تستحق أطول قائمة تشغيل لديك: انغمس في حبك للموسيقى ببطارية طويلة الأمد تفي بالمهمة - حتى لا تتوقف الموسيقى الخاصة بك حتى تتوقف\n\nاضغط للتحكم الكامل: تحكم في قائمة التشغيل الخاصة بك أو الرد على المكالمات بنقرة إصبع مع التحكم باللمس - لا مزيد من التحسس لهاتفك لتغيير أغنية\n\nقم بتبديلها: مع التبديل التلقائي، تكتشف سماعات الأذن الاتصال الذي تحتاجه وتحول الصوت على الفور إلى جهاز Galaxy هذا؛ يمكنك التنقل بسهولة بين هاتف Galaxy أو الجهاز اللوحي أو الساعة أو الكمبيوتر الشخصي. تتوافق Buds Controller مع Galaxy Buds plus وGalaxy Watch4 والموديلات التالية الخاصة بها.",
