     "color": "no color",
     "description": "Are you looking for comfortable and designer-looking wireless headphones? Be sure to check out the Ugreen Ugreen model. These are in-ear headphones equipped with Bluetooth\\ EQ mode supporting TWS MCSync technology. The manufacturer took care of every element of the structure to make it solid\\ and at the same time ideally suited to the shape of the ear. Thanks to this\\ even hours of listening to music becomes pleasant. This is also possible because a fully charged battery lasts up to 5 hours!\n\nCrystal clear sound quality\n\nThese Ugreen in-ear headphones are equipped with the Ariha AB1536 chipset\\ which supports the new MCSync TWS technology. Additionally\\ they have built-in 4 MEMS microphones that provide great sound and crystal clear conversations\\ but also a hassle-free connection to the device without any delay.\n\nYou will appreciate them for their excellent noise reduction\\ which effectively isolates from background noise\\ even in traffic.\n\nSuperb EQ mode - for a greater musical experience\n\nHiTune T1 equipped with advanced 6mm dynamic graphene drivers\\ which means reproduced sounds are detailed\\ rich and deep. These wireless earbuds feature an EQ mode that offers well-balanced bass settings. You can personalize the settings to suit your taste.\n\nConvenient touch control\n\nThrough touch control\\ you can quickly and conveniently adjust EQ settings\\ adjust volume\\ skip tracks\\ activate the voice assistant\\ turn many functions on and off.\n\nComfortable thanks to the adjustment to the ears\n\nHiTune T1 headphones have an ergonomic design. This arrangement at a special 30 ° angle ensures comfort throughout the day. Choose from silicone tips across the XS \/ S \/ M \/ L size range to suit adults\\ teenagers\\ women\\ and men.\n\nSuitable in all conditions\n\nThe ultra-light design of the earbuds weighs only 4.9 g. Additionally\\ they are IPX5 certified\\ which indicates water resistance - the device is protected against sweat and splash water. It is the best choice for people who practice jogging\\ yoga\\ cycling\\ commuting to work by public transport\\ participating in zoom meetings\\ and using FaceTime.\n\nVery long battery life\n\nYou can charge the HiTune wireless earbuds very quickly via the USB C port. A single charge provides up to 5 hours of playback\\ and placing in the charging case ensures over 24 hours in standby mode. Both the earbuds and the charging case can be fully charged in just 1.5 hours! After a quarter of an hour\\ you can play music for 1 hour.\n\nHigh quality\n\nHiTune T1 wireless earbuds are made of a perfectly smooth material that is free from fingerprints. Using them is comfortable\\ and to the touch they are extremely pleasant. They have a Hall-effect switch on the case that allows you to quickly pair with your hardware and remembers them to connect to it automatically in the future.\n\nSpecification:\n\nbrand: Ugreen\nCompatibility: with devices equipped with Bluetooth 5.0 iOS\\ Android\\ macOS and others\nBluetooth version: 5.0\nBluetooth range: 10m\nBluetooth protocol: HSP\\ HFP\\ AVRCP\\ A2DP\nEarphone battery capacity: 2 x 50 mAh\nCharger capacity: 500mAh 3.7V (1.85Wh)\nFrequency range: 20 - 20000Hz\nCharging port: USB Type C\nSpeaker sensitivity: 97 dB\nMicrophone sensitivity: 38 dB\nCharger input: 5V = 400mA\nCharger output: 5V = 100mA\nSet contains:\n\n1 x HiTune T1 Wireless earbuds\n1 x USB Type-C charging cable\n4 x silicone ear tips (size XS \/ S \/ M \/ L)\n1 x User Manual\nFor the most important information:\n\n4-mic wireless earbuds\nVery long battery life\nReliable EQ mode\nErgonomic shape of the headphones\nHeadphone end in size XS \/ S \/ M \/ L\\\nHigh-quality workmanship - designer look.",
     "Product Description (Ar)": "هل تبحث عن سماعات رأس لاسلكية مريحة وذات مظهر مصمم؟ تأكد من إطلاعك على نموذج يوجرين يوجرين. هذه سماعات داخل الأذن مزودة بتقنية Bluetooth ووضع EQ يدعم تقنية TWS MCSync. اهتمت الشركة المصنعة بكل عنصر من عناصر الهيكل لجعله صلبا ، وفي نفس الوقت مناسب بشكل مثالي لشكل الأذن. بفضل هذا ، حتى ساعات الاستماع إلى الموسيقى تصبح ممتعة. هذا ممكن أيضا لأن البطارية المشحونة بالكامل تدوم حتى 5 ساعات!\n\nجودة صوت فائقة الوضوح\n\nتم تجهيز سماعات الأذن Ugreen هذه بمجموعة شرائح Ariha AB1536 ، والتي تدعم تقنية MCSync TWS الجديدة. بالإضافة إلى ذلك ، لديهم 4 ميكروفونات MEMS مدمجة توفر صوتا رائعا ومحادثات واضحة تماما ، ولكن أيضا اتصالا خاليا من المتاعب بالجهاز دون أي تأخير.\n\nستقدر لهم تقليل الضوضاء الممتاز ، والذي يعزل بشكل فعال عن ضوضاء الخلفية ، حتى في حركة المرور.\n\nوضع EQ رائع - لتجربة موسيقية أكبر",
