     "name": "Belkin SOUNDFORM flow anc tws",
     "Product Title (Ar)": "بلكين ساوندفورم تدفق ANC tws",
     "size ": "no size",
     "color": "no color",
     "description": "Phone calls connected through dual beamforming technology feel like an in-person conversation\\ and the convenient Hear-Thru mode helps you stay alert to your surroundings for safety or to speak to people around you. Up to 7 hours of battery life per charge and another 24 hours of power in the wireless charging case offer true all-day listening pleasure. With IPX5-rated sweat- and water-resistant materials to keep up with weather and workouts\\ and easy connection via Bluetooth® 5.2\\ SOUNDFORM Flow is the perfect choice for no-noise\\ premium audio that lasts all day.\n\nCut the Noise\\ Hear Your Surroundings\nOur Active Noise Cancellation technology features a feedforward ANC mic that intelligently filters outside noise. Tap to switch on the convenient Hear-Thru mode to stay alert to your surroundings.\n\nDynamic Drivers\\ Dynamic Sound  \nLet high-quality sound flow with neodymium-magnet-equipped 12mm dual-layer dynamic drivers that deliver powerfully vivid audio quality with impactful bass.  \n\nCrystal Clear Call Quality\nDual beamforming technology ensures you can clearly hear and be heard on calls as if you're in the same room.  \n\nAll-Day Battery Life \nUp to 31 hours of battery life — 7 hours of playtime per charge for the earbuds\\ plus another 24 hours of battery in the wireless charging case mean you can talk\\ listen\\ and stream uninterrupted.  \n\nConvenient Wireless Charging\nWireless charging case offers convenient wire-free charging on any Qi-capable charging pad.  \n\nFast Recharging\nGet 60 minutes of playtime with just 10 minutes of USB-C charging. The full charge with 31 hours of playtime ​takes only 2 hours.\n\nSweat and Water Resistant \nKeep listening through light rain and challenging workouts. IPX5-rated materials in each earbud have you covered.\n\nReliable Connection\nBluetooth 5.2 technology is compatible with smartphones\\ tablets\\ and laptops\\ and connection is quick and easy within a 30 ft.\/10m range.\n\nEasy Touch Control\nEach wireless Bluetooth earbud responds to touch for wire-free\\ button-free audio control for phone calls\\ and to skip or pause songs.\n\nActive Noise Cancellation technology features a feedforward ANC mic that intelligently filters outside noise \nHear-Thru mode helps you stay alert to your surroundings  \n12mm dynamic drivers with neodymium magnets deliver powerfully vivid audio quality with impactful bass \nDual beamforming call technology ensures you can clearly hear and be heard as if you're in the same room   \n31 hours of total battery life — 7 hours of playtime in the earbuds\\ plus another 24 hours of power in the case   \nWireless charging case offers convenient wire-free charging on any Qi-capable charging pad  \n60 minutes of playtime with just 10 minutes of USB-C charging​  \nFast USB-C charging provides a full 31-hour charge in only 2 hours  \nSweat- and water-resistant IPX5-rated materials protect through bad weather and tough workouts   \nBluetooth 5.2 offers easy connection to devices up to 10M  \nWire-free\\ button-free touch offers true mono mode in each earbud\nPackage includes:\nSOUNDFORM™ Flow Noise Cancelling Earbuds \nQi™ charging case \n3 pairs silicone ear tips \nUSB-C® charging cable \nQuick Start Guide    ",
     "Product Description (Ar)": "\"تبدو المكالمات الهاتفية المتصلة من خلال تقنية تشكيل الشعاع المزدوج وكأنها محادثة شخصية ، ويساعدك وضع Hear-Thru المريح على البقاء في حالة تأهب لمحيطك من أجل السلامة أو التحدث إلى الأشخاص من حولك. يوفر عمر البطارية الذي يصل إلى 7 ساعات لكل شحنة و 24 ساعة أخرى من الطاقة في علبة الشحن اللاسلكي متعة استماع حقيقية طوال اليوم. مع مواد مقاومة للعرق والماء حاصلة على تصنيف IPX5 لمواكبة الطقس والتدريبات ، وسهولة الاتصال عبر Bluetooth® 5.2 ، يعد SOUNDFORM Flow الخيار الأمثل للصوت الممتاز الخالي من الضوضاء الذي يستمر طوال اليوم.\n\nقلل من الضوضاء، واستمع إلى محيطك\nتتميز تقنية إلغاء الضوضاء النشط الخاصة بنا بميكروفون ANC للتغذية الأمامية الذي يقوم بتصفية الضوضاء الخارجية بذكاء. انقر لتشغيل وضع Hear-Thru المريح للبقاء في حالة تأهب لما يحيط بك.\n\nمشغلات ديناميكية، صوت ديناميكي  \nدع الصوت عالي الجودة يتدفق مع محركات ديناميكية ثنائية الطبقة مقاس 12 مم مزودة بمغناطيس النيوديميوم توفر جودة صوت نابضة بالحياة بقوة مع صوت جهير مؤثر.  ",
