     "description": "Material: PC + ABS\nInput： Type-C charging 5V，500mA\nFeature: Bluetooth V5.0\nCharging Box 470mAh\nHeadphone 40mAh x 2\n4.5 Hours of charge (Up to 23 hours of playtime with the charging case)\nWaterproof Level: IPX5\nIT MAKES LIFE EASIER\n\nWireless hands-free and airbags are gradually replacing wired headphones and handsfree. It uses MCDODO HP-8020 bluetooth in-ear headphone version 5.0 and has a stable connection up to 10 meters. The battery capacity of MCDODO HP-8020 Bluetooth in-ear headphone is 470mAh\\ which is a good capacity. Its design is ergonomic and sweat resistant.\nMCDODO HP-8020 Bluetooth in-ear headphones sound quality\n\nMCDODO HP-8020 Bluetooth in-ear headphones\\ with its professional driver\\ offer sound with exceptional sensitivity and resolution in the frequency range of 20 - 35\\000 Hz.\nIts unique digital sound processor produces deep bass. Together with a powerful driver and a powerful processor\\ it is possible to use Bluetooth version 5.0 to create a stable and quality connection up to 10 meters.\nThis wireless headset has a built-in microphone with extra noise canceling technology that can be used for chats and phone calls.\nbattery capacity\n\nIt has a 4700mAh lithium polymer battery with a power that can be fully charged in about 1.5 hours.\nPlaytime is 4.5 Hours (Up to 23 hours playtime with charging case). There is a Type-C port for charging.\nErgonomic design of MCDODO HP-8020 wireless headset\n\nThe design of the MCDODO HP-8020 wireless headset is completely ergonomic. The small size and light weight of this headset make it usable for a long time without damage.\nThe silicone of these earphones in 3 different sizes is suitable for all ear sizes.\nThe charging dock of MCDODO HP-8020 weighs 38 grams and measures 56x40x26\\ so you can easily put it in your pocket or bag.\nPlugging and pairing with the phone is very simple and fast.\nIt will support\n\nMCDODO HP-8020 headset has comprehensive support for various operating systems and phones\\ tablets that support Bluetooth technology can be connected.\nUsing IPX5 technology\\ the MCDODO HP-8020 is sweat and water resistant\\ and is designed to stay in your ears and not fall out while exercising.\nAlso\\ as soon as you put it on your ear\\ you will notice that the sounds around you decrease and disappear a little.\nIn this way\\ you can listen to music with higher concentration and better understand the details of the music.\nSupports AAC\\ SBC and HiFi\n\nAAC and SBC are other audio codecs related features of this headset and you can listen to a wider range of music.\nAAC and SBC technology also helps with good reception and definition of audio codes and signals\\ ultimately bringing the details of the music to your ears.\nThis is because the sound you hear is of higher quality. Of course\\ to take advantage of these features\\ your phone must support it.\nAnother case is the support of HiFi technology. The process this technology performs means reproducing the sound in general and improves the quality of the sound\\ thus giving a higher quality. Your phone must support HiFi to take advantage of this mode\nClear conversations with ENC + 4 microphones\n\nEach earphone has 4 microphones. These microphones are for detecting extra ambient sounds as well as speech. \nThat way\\ if there is extra noise and noise around you\\ these microphones will detect and minimize them.\nA better quality call will take place and the person or people you are talking to will hear your voice well during the call.",
