     "Product Description (Ar)": "العلامة التجارية: Mcdodo\nطراز المنتج: PC - 1630\nمادة المنتج: TPU ، بولي كربونات PC\nالهيكل: 360 درجة ، المصد حول حواف الإطار مرن ، الجزء السفلي مغلق ، الجزء الخلفي غير لامع ، سطح الإطار الخلفي صلب وغير مرن.\nسطح التغطية: تغطية كاملة للجزء الخلفي من الهاتف وحواف الجانب ، أعلى وأسفل الهاتف ، حماية جميع الأزرار وغطاء حماية لعدسة الكاميرا\nمواصفات أخرى:\n\nاجتياز اختبارات الحماية ضد السقوط من ارتفاع مترين بسبب الوسائد الهوائية المثبتة في الزوايا الأربع للإطار.\nتتميز حواف الإطار بأنها ناعمة ومرنة مصنوعة من TPU والإطار الخلفي مصنوع من بولي كربونات PC صلب وحماية عالية في حالات الصدمات المحتملة.\nيحتوي على بروز حوالي 0.5 مم في المنطقة المحيطة بعدسة الكاميرا لمزيد من حماية العدسات.\nيدعم الشحن اللاسلكي باستخدام Magsafe من Apple دون تقليل سرعة الشحن اللاسلكي.\nيحتوي على وسائد هوائية وكبسولات هوائية مدمجة في مربع الإطار لحماية الهاتف من السقوط من ارتفاع والارتطامات القوية.\nيتميز بإمكانية مغناطيسية عالية الامتصاص بسبب 38 مغناطيسًا قويًا للغاية مدمجًا في الإطار الخلفي.\nيتميز بقصات دقيقة للغاية وغياب أي اضطراب في عمل الكاميرات والأزرار ومنافذ الإخراج.\nيتميز بشفافية مذهلة للإطار بدون اصفرار وأكسدة الإطار بسبب الاستخدام طويل الأمد.\nمريح للغاية في الإمساك ، مما يخلق شعورًا ممتعًا للغاية عند الاستخدام.\nيحتوي على بروز بمقدار ملليمتر واحد حول حواف الشاشة للحصول على حماية عالية لشاشة LCD التي تعمل باللمس.\nلا توجد تداخل في تشغيل الأزرار وكذلك منفذ الشحن وصورة الكاميرا بسبب تصميم دقيق للغاية.\nمتوافق مع جميع أجهزة الشحن اللاسلكية.\nخفيف الوزن للغاية ويتميز بتصميم نحيف للغاية.\nلا يسبب مشاكل في تشغيل مستشعرات القرب والكاميرا الرئيسية والكاميرا الأمامية للهاتف.\nيحتوي على طلاء خاص AF لمنع امتصاص البقع وبصمات الأصابع.\nحاصل على شهادات الصحة والسلامة RoHS.",
