     "Product Title (Ar)": "غطاء حماية وايوو لآيباد 10.2 بوصة\/10.5 بوصة - وردي",
     "size ": "no size",
     "color": "Pink",
     "description": "【Compatibility】This 10.2\/10.5 inch keyboard case is compatible with 10.2 inch iPad 9th 2021 (Model Number:A2603\/A2604\/A2605)\\ 10.2 inch iPad 8th 2020 (Model Number:A2270\/A2428\/A2429)\\10.2 inch iPad 7th 2019( Model Number: A2197\/A2200\/A2198)\\ iPad Air 3rd Gen 2019\\ iPad Pro 10.5 inch 2017. 5.1 High-speed Wireless enables fast response between keyboard and iPad\\ bringing the most efficient experience.\n【Magnetic Detachable Keyboard】The keyboard is firmly adsorbed on the protective case through a long magnetic strip. It can convert a more ergonomic typing angle through magnetic adsorption.The keyboard can also be removed and stored separately\\ leaving only the protective case and back stand. So the iPad can be placed on your knees to read\\ watch videos or draw pictures. This makes it easy to switch between iPad and Mac.\n【Multiple Stand Angles】The back of the protective case can be expanded from top to bottom to form a stand. The 180-degree stand angle can meet your needs for multiple perspectives such as writing\\ drawing\\ watching movies\\ playing games\\ and working. The stand is very stable and will not cause your iPad to suddenly fall backwards\\ it is suitable for use at home\\ school\\ office\\ and travel.\n【Efficient Protection】Using a new soft silicone protective case\\ iPad can be easily put in or taken out without scratching or jamming your device. Provide 360-degree protection when iPad accidentally falls\\ and it can also prevent other impacts\\ collisions\\ scratches or dust. The specially designed appearance fits the device very well. It will not block the keys and speakers of the iPad\\ and can easily access all ports such as the volume button\\ power button\\ camera\\ speaker\\ microphone\\ etc.\n【7 Backlight Colors】The keyboard has 7 backlight colors: blue\\ green\\ red\\ cyan\\ purple\\ yellow\\ and white. Press the light key + up\/down arrow to switch colors. Support three-level brightness adjustment to adapt to your indoor\\ outdoor or night use. Press the light key to adjust the brightness.\n【Long standby time】 The keyboard has a built-in rechargeable battery that can be used for recycling. The working time is 80 hours\\ the standby time can last for 150 days\\ and the charging only takes 2-3 hours. In order to save power and reduce battery consumption\\ iPad will be automatically disconnected after the keyboard is left for 10 minutes\\ and you can press any key on the keyboard to wake it up",
     "Product Description (Ar)": "【التوافق】 غطاء لوحة المفاتيح مقاس 10.2 \/ 10.5 بوصة متوافق مع iPad 9th 2021 مقاس 10.2 بوصة (رقم الطراز: A2603 \/ A2604 \/ A2605) ، iPad 10.2 بوصة 8th 2020 (رقم الطراز: A2270 \/ A2428 \/ A2429) ، 10.2 بوصة iPad 7th 2019 (رقم الطراز: A2197 \/ A2200 \/ A2198) ، iPad Air 3rd Gen 2019 ، iPad Pro 10.5 بوصة 2017. 5.1 تتيح الشبكة اللاسلكية عالية السرعة استجابة سريعة بين لوحة المفاتيح و iPad ، مما يوفر تجربة أكثر كفاءة.\n【لوحة مفاتيح مغناطيسية قابلة للفصل】 يتم امتصاص لوحة المفاتيح بإحكام على العلبة الواقية من خلال شريط مغناطيسي طويل. يمكنه تحويل زاوية كتابة أكثر راحة من خلال الامتزاز المغناطيسي. يمكن أيضا إزالة لوحة المفاتيح وتخزينها بشكل منفصل ، مع ترك العلبة الواقية والحامل الخلفي فقط. لذلك يمكن وضع iPad على ركبتيك للقراءة أو مشاهدة مقاطع الفيديو أو    رسم الصور. هذا يجعل من السهل التبديل بين iPad و Mac.    【زوايا حامل متعددة】 يمكن توسيع الجزء الخلفي من العلبة الواقية من أعلى إلى أسفل لتشكيل حامل. يمكن أن تلبي زاوية الحامل بزاوية 180 درجة احتياجاتك لوجهات نظر متعددة مثل الكتابة والرسم ومشاهدة الأفلام وممارسة الألعاب والعمل. الحامل مستقر للغاية ولن يتسبب في سقوط جهاز iPad فجأة للخلف ، فهو مناسب للاستخدام في المنزل والمدرسة والمكتب والسفر.\n【حماية فعالة】 باستخدام حقيبة واقية جديدة من السيليكون الناعم ، يمكن وضع iPad أو إخراجه بسهولة دون خدش أو تشويش جهازك. يوفر حماية بزاوية 360 درجة عند سقوط iPad عن طريق الخطأ ، ويمكنه أيضا منع الصدمات أو الاصطدامات أو الخدوش أو الغبار الأخرى. المظهر المصمم خصيصا يناسب الجهاز جيدا. لن يمنع مفاتيح ومكبرات الصوت في iPad ، ويمكنه الوصول بسهولة إلى جميع المنافذ مثل زر الصوت وزر الطاقة والكاميرا ومكبر الصوت والميكروفون وما إلى ذلك.    【7 ألوان الإضاءة الخلفية】 تحتوي لوحة المفاتيح على 7 ألوان للإضاءة الخلفية: الأزرق والأخضر والأحمر والسماوي والأرجواني والأصفر والأبيض. اضغط على مفتاح الضوء + السهم لأعلى \/ لأسفل لتبديل الألوان. دعم ضبط السطوع ثلاثي المستويات للتكيف مع استخدامك الداخلي أو الخارجي أو الليلي. اضغط على مفتاح الضوء لضبط السطوع.\n【وقت الانتظار الطويل】 تحتوي لوحة المفاتيح على بطارية مدمجة قابلة لإعادة الشحن يمكن استخدامها لإعادة التدوير. وقت العمل 80 ساعة ، ويمكن أن يستمر وقت الاستعداد لمدة 150 يوما ، ويستغرق الشحن 2-3 ساعات فقط. من أجل توفير الطاقة وتقليل استهلاك البطارية ، سيتم فصل iPad تلقائيا بعد ترك لوحة المفاتيح لمدة 10 دقائق ، ويمكنك الضغط على أي مفتاح على لوحة المفاتيح لإيقاظه",
