     "description": "The RAVPower RP-CB1020 Type-C to Lightning Cable is a 2-meter (6.6 feet) long cable that is designed to connect devices with a Lightning port\\ such as iPhones and iPads\\ to devices with a Type-C port\\ such as a MacBook or other laptops.\n\nThe cable is made of TPE material\\ which makes it durable\\ flexible\\ and resistant to tangling and wear and tear. The USB Type-C end of the cable can be connected to laptops\\ wall chargers\\ or other devices with a Type-C port\\ while the Lightning end can be plugged into your Apple device for charging and syncing data.\n\nThe RP-CB1020 is Apple MFi certified\\ which means it meets Apple's standards for quality and compatibility. It also supports fast charging for compatible devices\\ allowing you to quickly charge your Apple devices when you need them.\n\nWith a length of 2 meters\\ the cable provides greater flexibility and convenience\\ allowing you to use your devices more comfortably while they are charging. Additionally\\ the black color of the cable gives it a sleek and modern look.\n\nOverall\\ the RAVPower RP-CB1020 Type-C to Lightning Cable is a reliable and high-quality charging and syncing solution for your Apple devices and other devices with a Type-C port. Its durability\\ flexibility\\ and longer length make it a practical accessory for everyday use.\n\n \n\nBears folding up to 12\\000 times without deteriorating quality\nSupports fast charging of mobiles and devices\nIt is used to transfer data at high speed",
