     "name": "Belkin BOOSTCHARGE USB-C to Lightning Cable Black",
     "Product Title (Ar)": "كابل بلكين بوست تشارج يو إس بي-سي إلى لايتنينج أسود",
     "size ": "no size",
     "color": "Black",
     "description": "RELIABLE FAST CHARGING CABLES\nFast charge or easily sync music and photos to your iPhone or iPad with our reliable MFi-certified USB-C to Lightning cables. When paired with an 18W USB-PD Charger\\ you can see charge speeds for your iPhone 8 or later of 0 to 50% in 30 minutes.* MFi certification means your USB-C to Lightning cables are guaranteed to work with your iPhone and iPad\\ giving you peace of mind.\n\nCABLES THAT WON'T QUIT\n\nThese cables have been tested to withstand 8\\000+ bends\\** giving you more strength\\ and less worry about breakage.\n\nFeatures\nSupports fast charging\nAvailable in 1M\/3.3FT\nMFi certified for peace of mind\nTested to withstand 8\\000+ bends for maximum longevity\n2-year warranty",
     "Product Description (Ar)": "\nرحلة إلى عالم الصوت\n\nمع الصوت عالي الجودة والراحة الفائقة والملاءمة والمتانة الاستثنائية، تعد سماعات SOUNDFORM ذات موصل Lightning هي السماعات التي كنت تنتظرها أنت وهاتفك iPhone. تمتلئ هذه السماعات المدمجة بميزات، بما في ذلك مقاومة الماء وعزل الضوضاء، وتوفر صوتًا فائقًا دون تشتيت - حتى تتمكن من التوهان في الموسيقى أو النقل إلى عالم مختلف باستخدام كتاب صوتي أو تجربة الصعود والهبوط لكل قصة بمحتوى بودكاست جذاب.\n\nفرق Belkin\n\nرائدة في مجال الابتكار والتكنولوجيا لأكثر من 35 عامًا\nيوفر التصميم المبتكر ملاءمة مثالية لأذنك للحصول على صوت عالي الجودة وعزل ضوضاء\nتضمن إجراءات الاختبار الشاملة الجودة والمتانة\nمعتمد من MFi لمزيد من راحة البال\n\nملاءمة مثالية لصوت مثالي\n\nتخلق سماعات الرأس ذات الملاءمة المثالية صوتًا فائقًا. تجمع سماعات SOUNDFORM بين أطراف الأذن التي يمكن تخصيصها لأذنك، مع تصميم يوجه الصوت بنشاط نحو طبلة أذنك. والنتيجة هي عزل ضوضاء ممتاز، حتى يمكنك التأكد من أنك تستمتع بالموسيقى كما أراد الفنان. يتم تكرار كل إيقاع طبول، وكل كلمات الأغاني، وكل آلة، وكل نفس في التسجيل الأصلي بوضوح لأذنك. مع إعادة التشغيل الخالية من العيوب هذه، الشيء الوحيد الذي قد يضيع هو أنت.\n\nالراحة هي موسيقى لأذنيك\n\nسماعات الأذن غير الملائمة هي المساهم الرئيسي في عدم الراحة في سماعات الرأس. مع ثلاثة أطراف للأذن بأحجام مختلفة متوفرة مع سماعات SOUNDFORM، من السهل العثور على الملاءمة المناسبة لتجربة استماع أكثر راحة. تعمل برامج التشغيل بزاوية على تقليل الضغط على أذنك، بحيث يمكنك الاستمتاع بالراحة طوال اليوم والاستماع إلى الموسيقى التي تحبها، طالما أردت.\n\nمقاومة للعرق والرذاذ\n\nأينما تستمع إلى الموسيقى، تم تصميم سماعات SOUNDFORM لتذهب معك. لهذا السبب جعلناها مقاومة للعرق والرذاذ - مما يجعلها مثالية للاستخدام في جميع الأحوال الجوية، بالإضافة إلى جلسات اللياقة البدنية أو الصالة الرياضية.\n\nمتانة طويلة الأمد\n\nعلمتنا أكثر من 35 عامًا من الخبرة في تصميم الكابلات بعض الأشياء. سماعات SOUNDFORM مرنة للغاية ومعززة في نقاط الضغط الرئيسية، لتحمل الاستخدام المكثف في بيئات متعددة. تضمن إجراءات الاختبار الشاملة، التي تغطي كل شيء بدءًا من الاستخدام المستمر إلى الظروف البيئية القاسية، المتانة.\n\nخالية من التشابك\n\nيحافظ التصميم المسطح والخفيف الوزن على كابل سماعة الرأس خاليًا من التشابك في الجيب أو الحقيبة. أثناء الاستخدام، تحافظ ميزة إدارة الكابلات على الكابل الزائد بعيدًا عن طريقك وتضع الميكروفون في مكان مناسب للمكالمات بدون استخدام اليدين.\n\nوضعك في التحكم\n\nسماعات SOUNDFORM جاهزة للاستخدام مباشرة من الصندوق - لا يلزم وجود محول أو شحن مسبق. يسهل الزر متعدد التحكم التشغيل والإيقاف المؤقت وتخطي المسارات وتغيير مستوى الصوت أو الرد على مكالمة هاتفية بلمسة زر. يسهل الميكروفون المدمج الواضح إجراء المكالمات دون إزالة سماعات الرأس.\n\nضمان يمكنك الوثوق به\n\nنحن ملتزمون بالجودة ونقدم ضمانًا محدودًا لمدة عامين مع سماعات SOUNDFORM ذات موصل Lightning. تم تصميم هذا المنتج واختباره لضمان أداء لا تشوبه شائبة حتى مع الاستخدام المكثف.\n\nالمواصفات:\n\nطول الكابل 112 سم \/ 44 بوصة\n\nتتضمن الحزمة:\n\nسماعات SOUNDFORM ذات موصل Lightning\nأطراف أذن سيليكون، مقاس S ، M ، L\n\n",
