     "Product Description (Ar)": "شاحن حائط Mcdodo CH-1540\n\nالميزات:\n\nتصميم بثلاث منافذ: يسمح لك USB-A و 2 USB-C بشحن 3 أجهزة في نفس الوقت\nطاقة عالية 65 وات، مناسبة للهاتف المحمول والكمبيوتر اللوحي والكمبيوتر المحمول وجهاز الألعاب\nيدعم أيضًا وضع التيار المنخفض\nيمكن شحن سماعات الرأس والساعات الذكية\n7 مستويات من الحماية - حماية من الشحن الزائد، والحماية من التفريغ الزائد، والحماية من الجهد الزائد، والحماية من ارتفاع درجة الحرارة، والحماية من التيار الزائد، والحماية من الدائرة القصيرة، والحماية من المجال الكهرومغناطيسي، مما يوفر حماية كاملة لكل من الملحق والهاتف\nالمواصفات الفنية:\n\nالوزن: 109 جرام\nالطاقة: 65 وات\nالحجم: 32x37x98 مم\nالموصلات: USB و 2 USB Type-C\nمعيار الشحن السريع: PD3.0، QC4.0 +، QC3.0، SCP، FCP، AFC، PE\nخرج USB-C: 15 فولت ~ 3 أمبير، 9 فولت ~ 3 أمبير، 12 فولت ~ 3 أمبير، 15 فولت ~ 3 أمبير، 20 فولت ~ 3.35 أمبير، 67 وات بحد أقصى.\nخرج USB-C2: 5 فولت ~ 3 أمبير، 9 فولت ~ 3 أمبير، 12 فولت ~ 3 أمبير، 15 فولت ~ 3 أمبير، 20 فولت ~ 3.35 أمبير، 67 وات بحد أقصى.\nخرج USB-A: 4.5 فولت ~ 5 أمبير، 5 فولت ~ 4.5 أمبير، 9 فولت ~ 2 أمبير، 12 فولت ~ 1.5 أمبير، 20 فولت ~ 1.5 أمبير، 30 وات بحد أقصى.\nخرج USB-C1 + USB-C2: 45 وات + 20 وات (بحد أقصى 65 وات)\nخرج USB-C1 + USB-A: 45 وات + 18 وات (بحد أقصى 63 وات)\nخرج USB-C2 + USB-A: 5 فولت ~ 3.6 أمبير (بحد أقصى 18 وات)\nخرج USB-C1 + (USB-C2 + USB-A): 45 وات + 18 وات (بحد أقصى 63 وات)",
