     "Product Description (Ar)": "شاحن شبكة Mcdodo Nano Series PD 33W\n\nيمكن لشاحن الشبكة Nano Series PD 33W من Mcdodo شحن الهواتف المحمولة أو الأجهزة اللوحية أو أجهزة MacBook المتوافقة بسرعة. إنه مصنوع من مادة بلاستيكية (PC - Polycarbonate) مقاومة للتآكل اليومي ودرجات الحرارة العالية.\n\nالشاحن مثالي للسفر بوزن وأبعاد صغيرة ويمكنه شحن أجهزة مختلفة مثل الهواتف والأجهزة اللوحية و MacBook وغيرها.\n\nيوفر الشريحة الذكية المدمجة الحماية من الدائرة القصيرة والشحن الزائد وارتفاع درجة الحرارة أو التداخل الآخر الذي يمكن أن يؤثر على الشحن الصحيح لأجهزتك. كما أنه يتكيف مع التيار بحيث تتم عملية الشحن بأسرع ما يمكن دون إتلاف البطارية.\n\nالخصائص:\n\nالمادة: PC\nالوزن: 50 جرام\nالمنفذ: USB-C\nالإدخال: AC 100-240V 0.8A\nالإخراج 33W Max: 5V\/3A\\ 9V\/3A\\ 12V\/2.5A\\ 15V\/2A\\ 20V\/1.5A\\ PPS: 3.3V-11V\/3A\nالشحن السريع\nالأبعاد: 32.4 × 35.7 × 72.10 مم\nلا يشمل الكابل\nالأمان:\n\nتحتاج التقنيات المبتكرة أيضًا إلى ضمانات مناسبة، لذلك استخدمت الشركة المصنعة على سبيل المثال الأمان:\n\nكهروستاتية\nضد ارتفاع درجة الحرارة\nضد الجهد الزائد\nضد التحميل الزائد\nضد الدائرة القصيرة\nضد استهلاك الطاقة المفرط\nميزات المنتج:\n\nشركة مصنعة معروفة ومحترمة\nمنتج أصلي 100%\nالطراز: CH-0080\nالاسم: Nano 33W EU\nاللون: أبيض\nالتوافق: عالمي\nعدد منافذ USB: 1\nطاقة الإدخال: 100-240 فولت، 50\/60 هرتز، 0.8 أمبير\nطاقة الخرج: 5 فولت\/3 أمبير، 9 فولت\/3 أمبير، 12 فولت\/2.5 أمبير، 15 فولت\/2 أمبير، 20 فولت\/1.5 أمبير\nPPS 3.3V-11V\/3A\nكود الشركة المصنعة: CH-0080\nالمحتويات:\n\n1 × شاحن GaN من McDodo\n1 × دليل المستخدم\r",
