     "description": "Specification\n\nproduct name\n100W 4-Port USB PD Charger\ncolor        black\nmaterial\n\nPC fire\n\nmeasuring\n\n85*85*27mm\n\nWeight\n\n285g\n\nentrance        100-240V 50\/60Hz 2.5A\nproduction |        \nUSB-C1: 5V = 3A\\ 9V = 3A\\ 12V = 3A\\ 15V = 3A\\ 20V = 5A\\ 100W Max.\n\nUSB-C2: 5V = 3A\\ 9V = 3A\\ 12V = 3A\\ 15V = 3A\\ 20V = 5A\\ 100W Max.\n\nUSB-A1: 4.5V = 5A\\ 5V = 4.5A\\ 9V = 2A\\ 12V = 1.5A\\ 22.5W Max.\n\nUSB-A2: 4.5V = 5A\\ 5V = 4.5A\\ 9V = 2A\\ 12V = 1.5A\\ 22.5W Max.\n\nTotal production:\n\n100W Max.\n\nprotocols        PD QC3.0 FCP SCP AFC Apple 2.4A BC1.2\nHe writes        EU plug\npower        100W\n \n\nSolid construction\nThe adapter is made of high-quality materials\\ so it is resistant to wear and damage. It will surprise you with its modern design\\ and thanks to its compact design it will fit even in your pocket.\n\nExcellent sound quality\nThe built-in chip ensures stable data transmission\\ so you can enjoy excellent sound quality without distortion or delay. What's more\\ the adapter supports phone calls and does not affect the operation of the headphones' built-in remote control\\ so you can freely control music and calls without worrying about any interference.\n\nDon't give up your favorite entertainment\nYou no longer need to unplug your headphones to charge your device. The adapter allows you to plug in a Lightning charger and a 3.5mm jack at the same time. This allows you to comfortably watch a movie\\ play a game or listen to your favorite music while your device is charging. The product supports fast charging protocols\\ so you can replenish your phone or tablet in no time.",
     "Product Description (Ar)": "\"المواصفات\n\nاسم المنتج\nشاحن 100 واط 4 منافذ USB PD\nاللون أسود\nمادي\n\nحريق الكمبيوتر\n\nقياس\n\n85 * 85 * 27 ملم\n\nثقل\n\n٢٨٥ غرام\n\nمدخل 100-240 فولت 50\/60 هرتز 2.5 أمبير\nالإنتاج |        \nUSB-C1: 5 فولت = 3 أمبير ، 9 فولت = 3 أمبير ، 12 فولت = 3 أمبير ، 15 فولت = 3 أمبير ، 20 فولت = 5 أمبير ، 100 واط كحد أقصى.\n\nUSB-C2: 5 فولت = 3 أمبير ، 9 فولت = 3 أمبير ، 12 فولت = 3 أمبير ، 15 فولت = 3 أمبير ، 20 فولت = 5 أمبير ، 100 واط كحد أقصى.\n\nUSB-A1: 4.5 فولت = 5 أمبير ، 5 فولت = 4.5 أمبير ، 9 فولت = 2 أمبير ، 12 فولت = 1.5 أمبير ، 22.5 وات كحد أقصى.\n\nUSB-A2: 4.5 فولت = 5 أمبير ، 5 فولت = 4.5 أمبير ، 9 فولت = 2 أمبير ، 12 فولت = 1.5 أمبير ، 22.5 وات كحد أقصى.\n\nإجمالي الإنتاج:\n\n100 واط كحد أقصى.\n\nبروتوكولات PD QC3.0 FCP SCP AFC أبل 2.4A BC1.2\nيكتب قابس الاتحاد الأوروبي\nقوة 100W\n \nبناء متين\nالمحول مصنوع من مواد عالية الجودة ، لذا فهو مقاوم للتآكل والتلف. سوف يفاجئك بتصميمه الحديث ، وبفضل تصميمه المدمج ، سيكون مناسبا حتى في جيبك.\n\nجودة صوت ممتازة\nتضمن الشريحة المدمجة نقلا مستقرا للبيانات ، بحيث يمكنك الاستمتاع بجودة صوت ممتازة دون تشويه أو تأخير. علاوة على ذلك ، يدعم المحول المكالمات الهاتفية ولا يفعل n",
