     "size ": "no size",
     "color": "no color",
     "description": "Mcdodo 20W GaN PD Charger: This high-quality charger is designed to provide fast and efficient charging for your devices.\nGaN Technology: The charger utilizes GaN (Gallium Nitride) technology\\ which allows for a smaller and more compact design without compromising on power output.\n20W Power Delivery: With 20 watts of power delivery\\ this charger can rapidly charge your devices\\ including smartphones\\ tablets\\ and more.\nEU Plug: The charger comes with an EU plug\\ making it suitable for use in European countries and regions.\nFast Charging: The charger supports fast charging protocols\\ allowing you to quickly charge your devices and get them ready to use in no time.\nUniversal Compatibility: This charger is compatible with a wide range of devices\\ including iPhone\\ Samsung\\ Google Pixel\\ and other USB-C enabled devices.\nCompact and Portable: The compact design of this charger makes it easy to carry and travel with. It won't take up much space in your bag or luggage.\nSafe and Reliable: The charger features multiple safety features\\ including over-voltage protection\\ over-current protection\\ and short-circuit protection\\ ensuring the safety of your devices during charging.\nDurable Construction: Made with high-quality materials\\ this charger is built to last. It can withstand daily use and is resistant to wear and tear.\nLED Indicator: The charger is equipped with an LED indicator that shows the charging status\\ allowing you to easily monitor the charging progress.\nEnergy-efficient: The GaN technology used in this charger makes it highly energy-efficient\\ reducing power consumption and helping to save energy.\nBacked by Mcdodo: Mcdodo is a reputable brand known for its high-quality charging accessories. This charger comes with a warranty\\ giving you peace of mind and assurance of its quality.\nFast charging\nYou no longer have to wait indefinitely for your smartphone to be ready to use! The Mcdodo charger supports PD 20W fast charging. Thanks to this you will renew up to 60% of energy in just 30 minutes. You can successfully charge your iPhone 6-14 series\\ as well as your iPad with it.\n\nFor the sake of safety\nAre you worried about damaging your device while charging? Don't be! Multi-level protection reliably protects against overcurrent\\ short-circuits\\ overvoltage\\ overcharging or electrostatic discharge. You also don't have to worry about your smartphone overheating - all thanks to the dual heat dissipation structure and developed temperature control technology! What's more\\ once your device is charged to 80%\\ the charger automatically switches to Low-Current mode to protect your phone from overcharging.\n\nInnovative GaN technology\nGet ready for even faster and more efficient charging! The Mcdodo mains charger uses advanced GaN\\ or gallium nitride\\ technology to make charging faster\\ more efficient and safer than ever before. Thanks to the use of GaN\\ the charger is not only smaller and lighter\\ but also generates less heat\\ resulting in longer device life. Now you can enjoy convenience and mobility without sacrificing fast charging.\n\nThe perfect combination of functionality and design\nThe charger's lightweight and compact design means you can take it with you anywhere. It's compatible with a wide voltage range of 110-240V\\ so you can use it whether you're traveling domestically or internationally. And that's not all - the Mcdodo mains charger also features a modern and stylish design that is sure to attract the attention of many users.",
     "Product Description (Ar)": "شاحن Mcdodo 20W GaN PD: تم تصميم هذا الشاحن عالي الجودة لتوفير شحن سريع وفعال لأجهزتك.\nتقنية GaN: يستخدم الشاحن تقنية GaN (نيتريد الغاليوم) ، والتي تسمح بتصميم أصغر حجما وأكثر إحكاما دون المساومة على خرج الطاقة.\nتوصيل طاقة 20 واط: مع 20 واط من توصيل الطاقة ، يمكن لهذا الشاحن شحن أجهزتك بسرعة ، بما في ذلك الهواتف الذكية والأجهزة اللوحية والمزيد.\nقابس الاتحاد الأوروبي: يأتي الشاحن مع قابس الاتحاد الأوروبي ، مما يجعله مناسبا للاستخدام في البلدان والمناطق الأوروبية.\nالشحن السريع: يدعم الشاحن بروتوكولات الشحن السريع ، مما يتيح لك شحن أجهزتك بسرعة وتجهيزها للاستخدام في أي وقت من الأوقات.\nالتوافق العالمي: يتوافق هذا الشاحن مع مجموعة واسعة من الأجهزة ، بما في ذلك iPhone و Samsung و Google Pixel والأجهزة الأخرى التي تدعم USB-C.\nمدمج ومحمول: التصميم المدمج لهذا الشاحن يجعل من السهل حمله والسفر معه. لن تشغل مساحة كبيرة في حقيبتك أو أمتعتك.\nآمنة وموثوقة:",
