     "description": "7-in-2 USB-C Multiport Adapter\n\nEquipped with 4K HDMI\\ thunderbolt 3 port\\ USB Type-C Port\\ 2 USB 3.0 port\\ Micro SD\/SD Card Reader\\ this Macbook USB-C multiport adapter is a great expansion for MacBook Pro\/Air. \n\nPowerful Thunderbolt 3 Port\n\nThunderbolt 3 port supports power input of up to 100W\\ which gives your laptop 87W pass-through charge while connecting peripherals\\ and up to 40Gb\/s ultra-high data speed and 5K@60Hz video output; In addition\\ it’s also compatible with USB-C devices and supports 10Gb\/s data transmissions and 4K@60Hz output. Note: The other USB-C port is only for data transfer\\ not for charging and video output.\n\nCrystal Clear 4K HDMI Output\n\nMirror or extend the display of your MacBook Pro\/MacBook Air to TV\\ monitor or projector up to 4K UHD (3840 x 2160 @ 30Hz) resolution through the HDMI output port. Backward support 2K\/ 1080p\/ 720p\/ 480p\/ 360p resolutions.\n\nUniversal Micro SD\/SD Ready\n\nSD card and Micro SD card reader can transfer speed at up to 104M\/s\\ capacity of up to 2TB; Support SD\\ SDHC\\ SDXC\\ SD3.0 UHS-1. This USB-C hub can transfer photos or videos from your camera to laptop in just seconds.\n\nDurable and Compact Design\n\nThis Macbook USB-C multiport adapter is made of neat and sleek aluminum enclosure\\ it is very durable and sturdy. Weighting just 1.4 ounces and stylishly slim\\ it is designed to be as portable as possible. Perfect for static use and on-the-go.\n\nCompatible Devices\n\nMacBook Pro 13 \"2020\/2019\/2018 \/ 2017\/2016\nMacBook Pro 15\" 2019\/2018\/2017\/2016\nMacBook Pro 16 \"2019\/2020\\\nMacBook Air 2020\/2019\/2018",
     "Product Description (Ar)": "محول متعدد المنافذ 7 في 2 USB-C\n\nمزود بمنفذ HDMI 4K، ومنفذ ثاندربولت 3، ومنفذ USB من النوع C، ومنفذين USB 3.0، وقارئ بطاقات Micro SD\/SD، يعد محول Macbook USB-C متعدد المنافذ امتدادًا رائعًا لجهاز MacBook Pro\/Air.\n\nمنفذ ثاندربولت 3 قوي\n\nيدعم منفذ Thunderbolt 3 مدخلات طاقة تصل إلى 100 وات، مما يمنح الكمبيوتر المحمول الخاص بك شحنًا مروريًا بقدرة 87 وات أثناء توصيل الأجهزة الطرفية، وسرعة بيانات فائقة تصل إلى 40 جيجابايت\/ثانية وإخراج فيديو 5 كيلو عند 60 هرتز؛ بالإضافة إلى ذلك، فهو متوافق أيضًا مع أجهزة USB-C ويدعم نقل البيانات بسرعة 10 جيجابايت\/ثانية وإخراج 4K@60 هرتز. ملحوظة: منفذ USB-C الآخر مخصص فقط لنقل البيانات، وليس للشحن وإخراج الفيديو.\n\nمخرج HDMI بدقة 4K\n\nقم بعكس أو توسيع شاشة جهاز MacBook Pro\/MacBook Air الخاص بك إلى التلفزيون أو الشاشة أو جهاز العرض بدقة تصل إلى 4K UHD (3840 x 2160 @ 30 هرتز) من خلال منفذ إخراج HDMI. دعم خلفي لدقة 2K\/ 1080p\/ 720p\/ 480p\/ 360p.\n\nعالمي مايكرو SD\/SD جاهز\n\nيمكن لبطاقة SD وقارئ بطاقات Micro SD نقل السرعة بسرعة تصل إلى 104 ميجابايت\/ثانية، بسعة تصل إلى 2 تيرابايت؛ دعم SD، SDHC، SDXC، SD3.0 UHS-1. يمكن لمحور USB-C هذا نقل الصور أو مقاطع الفيديو من الكاميرا إلى الكمبيوتر المحمول في ثوانٍ معدودة.\n\nتصميم متين وصغير الحجم\n\nمحول Macbook USB-C متعدد المنافذ مصنوع من غلاف ألومنيوم أنيق وأنيق، وهو متين وقوي للغاية. يبلغ وزنه 1.4 أونصة فقط وهو نحيف بشكل أنيق، وهو مصمم ليكون سهل الحمل قدر الإمكان. مثالية للاستخدام الثابت وأثناء التنقل.\n\nالأجهزة المتوافقة\n\nماك بوك برو 13 \"2020\/2019\/2018 \/ 2017\/2016\nماك بوك برو 15 بوصة 2019\/2018\/2017\/2016\nماك بوك برو 16 \"2019\/2020\\\nماك بوك اير 2020\/2019\/2018",
