     "description": "brand: Choetech\nModel: XCC-1036\nUSB standard: USB2.0\nBlack colour\nConnector type: USB-C (male)\nData transfer: 480 Mb\/s\nSupported power: up to 240W\nCable length: 2m\nCharging support: Power Delivery 3.1 240W\nA modern cable for demanding users\nThe Choetech USB-C cable is a convenient and versatile solution that will work in many situations. It allows for fast and stable signal transmission at speeds up to 480 Mbps and enables fast charging of devices thanks to Power Delivery 3.1 support up to 240 W.\n\nInstantly charge your devices\nIt is an excellent product for people who appreciate the speed of charging their equipment. Thanks to the support of the PD 240 W fast charging protocol\\ the cable allows you to quickly charge the device. For example\\ charging the MacBook Pro 2021 to 39% takes only about 30 minutes. Thanks to this\\ the user does not have to wait long for a full charge and can quickly return to work.\n\nWide Compatibility\nThe Choetech cable works with a variety of devices including smartphones\\ laptops\\ SSDs\\ hubs and more.\n\nThe most important advantages of the Choetech USB-C cable:\n\nFast Charging : Thanks to the support of the PD3.1 fast charging protocol\\ the 240W Choetech cable allows you to quickly charge devices such as smartphones or laptops.\nSafety : The Choetech cable is designed with user and device safety in mind.\nWide Compatibility : Works with various types of devices such as smartphones\\ laptops\\ SSDs\\ and hubs.",
     "Product Description (Ar)": "\"العلامة التجارية: تشويتك\nالموديل: XCC-1036\nمعيار USB: USB2.0\nلون أسود\nنوع الموصل: USB-C (ذكر)\nنقل البيانات: 480 ميجا بايت\/ثانية\nالطاقة المدعومة: ما يصل إلى 240 واط\nطول الكابل: 2 م\nدعم الشحن: توصيل الطاقة 3.1 240 واط\nكابل حديث للمستخدمين المتطلبين\nيعد كابل Choetech USB-C حلاً مريحًا ومتعدد الاستخدامات يعمل في العديد من المواقف. فهو يسمح بنقل إشارة سريع ومستقر بسرعات تصل إلى 480 ميجابت في الثانية ويتيح الشحن السريع للأجهزة بفضل دعم Power Delivery 3.1 الذي يصل إلى 240 واط.\n\nاشحن أجهزتك على الفور\nإنه منتج ممتاز للأشخاص الذين يقدرون سرعة شحن أجهزتهم. بفضل دعم بروتوكول الشحن السريع PD 240 W، يتيح لك الكابل شحن الجهاز بسرعة. على سبيل المثال، يستغرق شحن جهاز MacBook Pro 2021 بنسبة 39% حوالي 30 دقيقة فقط. وبفضل هذا، لن يضطر المستخدم إلى الانتظار لفترة طويلة حتى يتم الشحن بالكامل ويمكنه العودة إلى العمل بسرعة.\n\nتوافق واسع\nيعمل كابل Choetech مع مجموعة متنوعة من الأجهزة بما في ذلك الهواتف الذكية وأجهزة الكمبيوتر المحمولة ومحركات أقراص SSD والمحاور والمزيد.\n\nأهم مميزات كابل Choetech USB-C:\n\nشحن سريع: بفضل دعم بروتوكول الشحن السريع PD3.1، يتيح لك كابل Choetech بقدرة 240 واط شحن الأجهزة بسرعة مثل الهواتف الذكية أو أجهزة الكمبيوتر المحمولة.\nالسلامة: تم تصميم كابل Choetech مع الأخذ في الاعتبار سلامة المستخدم والجهاز.\nتوافق واسع: يعمل مع أنواع مختلفة من الأجهزة مثل الهواتف الذكية وأجهزة الكمبيوتر المحمولة ومحركات أقراص SSD والمحاور.",
