     "Product Title (Ar)": "IP0041 Choetech \" MFI USB-C إلى كابل لايتنينج \nالطول: 2 م \"\n",
     "size ": "no size",
     "color": "no color",
     "description": "PD Fast Charging\n\nUse this USB-C to Lightning Charging Cable with your USB-C power delivery adapters (including Apple 29W\\ 30W\\ 61W\\ or 87W) to access fast-charging for iPhone 11\\ 11 Pro\\ 11 Pro Max\\ 8\\ 8 Plus\\ X\\ XS\\ XR\\ XS Max\\ and later models.\n\nMFi Certified Charging Cable\n\nApple MFi certified charging and syncing USB-C to Lightning Charging Cable\\ made for iPhone\\ iPad\\ iPod with authorization chip issued by Apple to ensure 100% compatibility with the iOS system.\n\nDouble-Braided Nylon\n\nMade with tough and durable nylon to add to the cord protection and flexibility\\ and proven to withstand strict laboratory tests and numerous bending. \n\nBuilt-to-Last\n\nThis Lightning Charging Cable uses the new C94 Lightning connector which brings a much higher power for fast charging. USB-IF Certified (TID: 200000260\\ safe for charging and syncing. \n\nPerfect Length\n\nWith this 6.6ft-long cord\\ you can lie on the couch\\ charge and send messages simultaneously. The ultra-long cable offers the extra freedom to charge your devices in your bedroom\\ office or even in the backseat of your car.",
     "Product Description (Ar)": "\"PD شحن سريع\n\nاستخدم كابل الشحن USB-C إلى Lightning مع محولات توصيل الطاقة USB-C (بما في ذلك Apple 29W، 30W، 61W، أو 87W) للوصول إلى الشحن السريع لأجهزة iPhone 11، 11 Pro، 11 Pro Max، 8، 8 Plus، X، XS، XR، XS Max، والنماذج الأحدث.\n\nكابل شحن معتمد من MFi\n\nكابل شحن ومزامنة USB-C إلى Lightning معتمد من Apple MFi، مصنوع لأجهزة iPhone وiPad وiPod مع شريحة ترخيص صادرة عن Apple لضمان التوافق بنسبة 100% مع نظام iOS.\n\nنايلون مزدوج المضفر\n\nمصنوع من النايلون القوي والمتين ليضيف إلى حماية السلك ومرونته، وثبت أنه يتحمل الاختبارات المعملية الصارمة والانحناءات المتعددة.\n\nبني ليبقى\n\nيستخدم كابل شحن Lightning موصل C94 Lightning الجديد الذي يوفر طاقة أعلى بكثير للشحن السريع. معتمد من USB-IF (TID: 200000260، آمن للشحن والمزامنة.\n\nالطول المثالي\n\nمع هذا السلك الذي يبلغ طوله 6.6 قدم، يمكنك الاستلقاء على الأريكة والشحن وإرسال الرسائل في وقت واحد. يوفر الكابل الطويل جدًا حرية إضافية لشحن أجهزتك في غرفة نومك أو مكتبك أو حتى في المقعد الخلفي لسيارتك.",
