     "size ": "no size",
     "color": "no color",
     "description": "Model\nIP0039\nQuick USB-C Charging Cable\nThe USB Type-C to Lightning cable supports PD fast charging\\ up to 20W max output. Charge your iPhone 12 from 0% to 55% in just 30 mins.\nNote: The wall charger is not included.\nHigh-Speed Data Transfer\nTransfer music\\ movies\\ and photo albums in seconds. Built for flawless performance and even greater durability.\nMFi Certified\nChoetech’s USB-C to Lightning cable has completed all the MFi certification requirements. Through strict quality testing Choetech will ensure the safety of your Apple devices even when fast charging at the highest speed.\nPackage Content\n1 x Choetech USB Type-C to Lightning cable\\ 1 x User Manual\nPD Fast Charging Cable \n\nPD Fast Charging Cable is compatible with iPhone Series 14\\ 13\\ 12\\ 11 and earlier\\ as well as AirPods and AirPods Pro.\n\nMFi Certified\n\nApple MFi certified charging and syncing Lightning to USB-C cable\\ made for iPhone\\ iPad\\ iPod with authorization chip issued by Apple to ensure 100% compatibility with the iOS system.\n\nDouble-braided\n\nMade with tough and durable nylon to add cord protection and flexibility\\ and proven to withstand over 10\\000+ bends in strict laboratory tests.\n\nBuilt-to-Last\n\nThe USB Type-C to Lightning cable uses the new C94 Lightning connector which is better suitable for fast charging. Our USB-C to Lightning cable is USB-IF Certified (TID: 200000260) and is safe to use for charging and syncing.\n\nHigh Speed Syncing\n\nUse this Lightning to USB-C cable to connect your iPhone with MacBook to pursue a higher data transfer speed of up to 480Mbps - sync and charge faster and safer with Choetech. \n",
