     "description": "Small Yet Mighty! Choetech's 33W Dual Port Wall Charger is 59% smaller in size than Apple's charger without compromising it's performance and fast charging capabilities.  Fast charge two devices simultaneously\\ including laptops and tablets. \n33W Output Power \nWith a total output of up to 33W\\ this dual USB-A and USB-C wall charger will intelligently identify your devices and provide the fastest and most efficient output current - 33W for the USB-C port\\ 30W for the USB-A port. \nDual PD Fast Charging Ports\nThis charger with two PD 3.0 & QC 3.0 power delivery ports can simaltaneously fast charge which will save you time and save outlet place when have to charge two devices. If you use both the USB-C and the USB-A port then the total output power will amount to 22.5W Universal Compatibility\nPD20W Fast Charge Mode - iPhone Series 13\/12\\ 18W QC Fast Charge Mode - iPhone 11\/X\/XR\/8 Series and Nintendo Switch\\ 25W PD Fast Charge Mode - Samsung S21\/S20 Series\/Samsung Note 10\/10+\\ AirPods 2\/Pro\/Apple Watch Series 1-8\/Wireless Chargers\\ 30W PD\/QC High-speed Charge Mode for iPad\/Tablets\/Laptops. \nIncredibly Compact & Secure\nWith Dual USB-C and USB-A ports in one charger plug\\ sleek and small enough to easily slip into your purse or pocket - designed to be ideal to travel with. With an intelligent chip inside\\ this 33W wall adapter offers multiple safeguards against excessive current\\ overheating and overcharging.\nPackage Content\n1 x 33W Dual Port Wall Charger\n1 x User Manual",
     "Product Description (Ar)": "\"صغير ولكنه قوي! شاحن الحائط ثنائي المنفذ بقدرة 33 واط من Choetech أصغر حجمًا بنسبة 59% من شاحن Apple دون المساس بأدائه وقدرات الشحن السريع. شحن سريع لجهازين في وقت واحد، بما في ذلك أجهزة الكمبيوتر المحمولة والأجهزة اللوحية.\nطاقة الإخراج 33 واط\nمع إجمالي إخراج يصل إلى 33 واط، سيحدد شاحن الحائط المزدوج USB-A وUSB-C أجهزتك بذكاء ويوفر تيار الإخراج الأسرع والأكثر كفاءة - 33 واط لمنفذ USB-C، و30 واط لمنفذ USB-A .\nمنافذ شحن سريعة PD مزدوجة\nيمكن لهذا الشاحن المزود بمنفذي توصيل الطاقة PD 3.0 وQC 3.0 الشحن السريع في نفس الوقت مما سيوفر لك الوقت ويوفر مكان المخرج عند الحاجة إلى شحن جهازين. إذا كنت تستخدم كلاً من منفذ USB-C ومنفذ USB-A، فإن إجمالي طاقة الخرج سيصل إلى 22.5 واط.\nوضع الشحن السريع PD20W - iPhone Series 13\/12، وضع الشحن السريع 18W QC - سلسلة iPhone 11\/X\/XR\/8 وNintendo Switch، وضع الشحن السريع 25W PD - سلسلة Samsung S21\/S20\/Samsung Note 10\/10+، AirPods 2\/Pro\/Apple Watch Series 1-8\/شواحن لاسلكية، وضع شحن عالي السرعة بقدرة 30 وات PD\/QC لأجهزة iPad\/الأجهزة اللوحية\/أجهزة الكمبيوتر المحمولة.\nمدمج وآمن بشكل لا يصدق\nمع منافذ USB-C وUSB-A المزدوجة في قابس شاحن واحد، فهو أنيق وصغير بما يكفي لينزلق بسهولة في محفظتك أو جيبك - مصمم ليكون مثاليًا للسفر معه. مع وجود شريحة ذكية بالداخل، يوفر محول الحائط بقدرة 33 وات ضمانات متعددة ضد التيار الزائد والسخونة الزائدة والشحن الزائد.\nمحتوى الحزمة\n1 × شاحن حائط بمنفذين 33 وات\n1 × دليل المستخدم\"",
