     "name": "PD5007 Choetech PD30W GaN Tech Wall Charger for MacBook Air\/iPhone iphone 14\/13\/12  EU\n",
     "Product Title (Ar)": "PD5007 شوتيك PD30W غان التكنولوجيا شاحن الجدار لماك بوك اير \/ اي فون اي فون 14\/13\/12 الاتحاد الأوروبي\n",
     "size ": "no size",
     "color": "no color",
     "description": "Choetech GaN USB Type C 30W charger\\ Power Delivery (PD5007)\n\nChoetech fast GaN wall charger equipped with a USB Type C port\\ which allows charging with a power of up to 30W. It allows you to quickly charge devices in the PD (Power Delivery) standard. It has been equipped with many protections\\ such as overheating\\ overvoltage\\ high voltage or overload. The electronic components of the charger are made in GaN technology\\ i.e. they are based on gallium nitride\\ not on silicon. GaN means better work efficiency and lower energy consumption.\n\nSpecification\n\nInput current: AC 100-240V\\ 0.8A\\ 50 \/ 60Hz\nOutput current: 5V \/ 3A\\ 9V \/ 3A\\ 12V \/ 2.5A\\ 15V \/ 2A\\ 20V \/ 1.5A\nWeight: 67g\nBlack colour\nCertificates: CE\\ FCC\\ CCC\\ ROHS\nFast Charging: Power Delivery\nComponents made in GaN technology\nThe most important advantages\n\nWorking with power up to 30W. The charger transfers to the USB Type C port with a load of up to 30W.\nMade in GaN technology. Components made of gallium nitride withstand a greater load with less energy loss due to the generated heat. This makes the charger more efficient and consumes less electricity.\nPower Delivery fast charging. The PD standard allows for even faster and more effective charging of mobile devices.\nBuilt-in security systems. The charging process is constantly monitored by the processor controlling the operation of the charger. He deals with\\ among others protection against overheating\\ overvoltage\\ overload and electrostatic discharge.",
     "Product Description (Ar)": "شاحن شوتيك GaN USB Type C 30 واط، توصيل الطاقة (PD5007)\n\nشاحن حائط Choetech سريع GaN مزود بمنفذ USB من النوع C، والذي يسمح بالشحن بقوة تصل إلى 30 واط. يسمح لك بشحن الأجهزة بسرعة بمعيار PD (توصيل الطاقة). وقد تم تجهيزه بالعديد من وسائل الحماية، مثل الحرارة الزائدة، والجهد الزائد، والجهد العالي أو التحميل الزائد. المكونات الإلكترونية للشاحن مصنوعة بتقنية GaN، أي أنها تعتمد على نيتريد الغاليوم، وليس على السيليكون. GaN يعني كفاءة عمل أفضل واستهلاك أقل للطاقة.\n\nتخصيص\n\nتيار الإدخال: تيار متردد 100-240 فولت، 0.8 أمبير، 50 \/ 60 هرتز\nتيار الخرج: 5 فولت \/ 3 أمبير، 9 فولت \/ 3 أمبير، 12 فولت \/ 2.5 أمبير، 15 فولت \/ 2 أمبير، 20 فولت \/ 1.5 أمبير\nالوزن: 67 جرام\nلون أسود\nالشهادات: CE، FCC، CCC، ROHS\nالشحن السريع: توصيل الطاقة\nالمكونات المصنوعة بتقنية GaN\nأهم المزايا\n\nالعمل بقوة تصل إلى 30 واط. ينتقل الشاحن إلى منفذ USB من النوع C بحمل يصل إلى 30 وات.\nمصنوعة بتقنية GaN. تتحمل المكونات المصنوعة من نيتريد الغاليوم حمولة أكبر مع فقد أقل للطاقة بسبب الحرارة المتولدة. وهذا يجعل الشاحن أكثر كفاءة ويستهلك كهرباء أقل.\nتوصيل الطاقة شحن سريع. يسمح معيار PD بشحن الأجهزة المحمولة بشكل أسرع وأكثر فعالية.\nأنظمة أمنية مدمجة. تتم مراقبة عملية الشحن بشكل مستمر من خلال المعالج الذي يتحكم في تشغيل الشاحن. إنه يتعامل، من بين أمور أخرى، مع الحماية ضد الحرارة الزائدة والجهد الزائد والحمل الزائد والتفريغ الكهروستاتيكي.\"",
