     "Product Description (Ar)": "\"مجهز بمنفذ توصيل طاقة USB-C بقدرة 20 واط لشحن iPhone 12\/12 Pro\/12 Pro Max\/ 11\/11 Pro\/XS\/XR\/X وiPad Pro وiPad Air وGalaxy S10 \/ S9 وهواتف وأجهزة الكمبيوتر اللوحية الأخرى من Samsung أسرع بما يصل إلى 3 مرات من الشاحن الأصلي. يتوافق هذا الشاحن السريع من النوع C بشكل مثالي وأقصى سرعة شحن محسّنة لأي جهاز محمول تقريبًا.\nالموديل: Q5004\nشاحن iPhone سريع الشحن: يتيح لك شاحن الحائط من النوع C هذا المزود بأحدث تقنيات الشحن السريع PD، شحن هاتف iPhone 12 الخاص بك بنسبة تصل إلى 50% في حوالي 30 دقيقة، وكذلك الشحن السريع لجهاز iPhone 8 والموديلات الأحدث. إنه أسرع بثلاث مرات من الشاحن الأصلي بقدرة 5 واط.\nحماية أمان متعددة: يحتوي الشاحن السريع من النوع C على حماية مدمجة لحماية جهازك من التيار الزائد وارتفاع درجة الحرارة والشحن الزائد! شاحن PD معتمد من MFI وآمن للاستخدام، جهد ثابت، آمن، شحن سريع، لن يسخن، تصميم حماية من الشحن الزائد وشريحة ذكية مدمجة يمكنها حماية أجهزة iPhone\/iPad الخاصة بك أثناء الشحن والمزامنة!\nشاحن حائط متين من النوع C: محول شاحن USB-C iPhone 12 بقدرة 20 وات مصمم بغلاف قوي ومكونات داخلية متميزة يمكنها تحمل الخدوش أو الصدمات أو السقوط.\nما تحصل عليه: شاحن iPhone سريع الشحن بقدرة 20 واط من Choetech*1، دليل المستخدم*1\"",
