     "description": "Two Is Better\nCharge 2 devices at once with dual pads charging surfaces\\ supports fast charging speed for both Phones and EarBuds. Advanced Qi wireless charging technology enables you to charge your device without plugging in a cable. \n\nPremium & Safe Design\n\nDesigned with anti-slip PU leather surface and anti-slip pads on the bottom help keep your pad in place\\ heat dissipation holes at the bottom to keep your phone cool while charging. integrated smart chip inside provides better temperature control\\ surge protection\\ short-circuit prevention\\ overheating\\ overvoltage prevention and more. Package Content:\n\n1 x 2-in-1 Wireless Charging Pad\n\n1 x Qualcomm 18W Quick Charge Adapter\n\n1 x USB-C Charging Cable\n\n1 x User Manual",
     "Product Description (Ar)": "\"اثنان أفضل\nاشحن جهازين في وقت واحد باستخدام أسطح الشحن المزدوجة، ويدعم سرعة الشحن السريع لكل من الهواتف وسماعات الأذن. تتيح لك تقنية الشحن اللاسلكي Qi المتقدمة شحن جهازك دون توصيل كابل.\n\nتصميم متميز وآمن\n\nمصمم بسطح من جلد البولي يوريثان المضاد للانزلاق ومنصات مضادة للانزلاق في الأسفل تساعد على إبقاء وسادتك في مكانها، وفتحات تبديد الحرارة في الأسفل للحفاظ على برودة هاتفك أثناء الشحن. توفر الشريحة الذكية المدمجة بالداخل تحكمًا أفضل في درجة الحرارة، وحماية من زيادة التيار، ومنع الدائرة القصيرة، وارتفاع درجة الحرارة، ومنع الجهد الزائد والمزيد. محتوى العبوة:\n\n1 × 2 في 1 لوحة شحن لاسلكية\n\n1 × محول كوالكوم 18 واط للشحن السريع\n\n1 × كابل شحن USB-C\n\n1 × دليل المستخدم\"",
