     "color": "no color",
     "description": "The RAVPower RP-PC1031 PD Pioneer Wall Charger is a compact and efficient charging device that features two USB ports\\ including one USB-C port with Power Delivery (PD) technology. The USB-C port can deliver up to 30 watts of power\\ which makes it ideal for charging laptops\\ tablets\\ and other larger devices that support PD technology. The second USB-A port provides up to 12 watts of power\\ which is suitable for charging smartphones and other smaller devices.\n\nThe charger is designed with multiple safety features to protect your devices during charging\\ including overcharging\\ overheating\\ and short-circuit protection. It also has a foldable plug for easy portability and storage.\n\nThe RP-PC1031 is compatible with a wide range of devices that support USB-C PD technology\\ including laptops from brands like Apple\\ Dell\\ HP\\ and Lenovo\\ as well as smartphones and tablets from various manufacturers. It can also be used with a variety of USB-C cables\\ although it is recommended to use a cable that supports PD technology for optimal charging speed.\n\nOverall\\ the RAVPower RP-PC1031 PD Pioneer Wall Charger is a reliable and efficient charging solution that offers fast charging speeds and a high level of safety for your devices. The dual-port design makes it a convenient option for charging multiple devices at once.\n\n35 Watts fast wall charger\nCharge two devices simultaneously\nCompact design\nUniversal compatibility\nPowered by GaN Technology",
     "Product Description (Ar)": "شاحن الحائط RAVPower RP-PC1031 PD Pioneer هو جهاز شحن مدمج وفعال يتميز بمنفذي USB، بما في ذلك منفذ USB-C مع تقنية توصيل الطاقة (PD). يمكن لمنفذ USB-C توفير ما يصل إلى 30 واط من الطاقة، مما يجعله مثاليًا لشحن أجهزة الكمبيوتر المحمولة والأجهزة اللوحية وغيرها من الأجهزة الأكبر حجمًا التي تدعم تقنية PD. يوفر منفذ USB-A الثاني ما يصل إلى 12 واط من الطاقة، وهو مناسب لشحن الهواتف الذكية والأجهزة الأخرى الأصغر حجمًا.\n\nتم تصميم الشاحن بميزات أمان متعددة لحماية أجهزتك أثناء الشحن، بما في ذلك الشحن الزائد وارتفاع درجة الحرارة وحماية الدائرة القصيرة. كما أنها تحتوي على قابس قابل للطي لسهولة الحمل والتخزين.\n\nيتوافق RP-PC1031 مع مجموعة واسعة من الأجهزة التي تدعم تقنية USB-C PD، بما في ذلك أجهزة الكمبيوتر المحمولة من علامات تجارية مثل Apple وDell وHP وLenovo، بالإضافة إلى الهواتف الذكية والأجهزة اللوحية من مختلف الشركات المصنعة. ويمكن استخدامه أيضًا مع مجموعة متنوعة من كابلات USB-C، على الرغم من أنه يوصى باستخدام كابل يدعم تقنية PD للحصول على سرعة شحن مثالية.\n\nبشكل عام، يعد شاحن الحائط RAVPower RP-PC1031 PD Pioneer حل شحن موثوقًا وفعالًا يوفر سرعات شحن سريعة ومستوى عالٍ من الأمان لأجهزتك. يجعله تصميم المنفذ المزدوج خيارًا مناسبًا لشحن أجهزة متعددة في وقت واحد.\n\nشاحن جداري سريع بقوة 35 واط\nاشحن جهازين في وقت واحد\nتصميم مضغوط\nالتوافق العالمي\nمدعوم بتقنية GaN",
